pub async fn authorize( #[handler] role: impl UserRole, #[request] rp: &Request<Body>, #[inject] algo_provider: Arc<dyn JwtAlgorithmProvider>, #[inject] token_ext: Arc<dyn TokenExtractor>, #[inject] secret_provider: Arc<dyn JwtSecretProvider>,
